import { Row,Col, Container } from 'react-bootstrap';
import './App.css';
import {Hasil, ListCategori, NavbarComponent} from "./components/index"
import React, { Component } from 'react'

export default class App extends Component {
  render() {
    return (
       <div className="App">
          <NavbarComponent />
          <div className="mt-3">
            <Container fluid>
              <Row>
               <ListCategori />
              <Col>
              <h4><strong>Daftar Produk</strong></h4>
              <hr />
              </Col>
              <Hasil/>
              </Row>
            </Container>
      </div>

    </div>
    )
  }
}
